var render = function render() {
  var _vm = this,
    _c = _vm._self._c
  return _c(
    "ContentSlotsDistributor",
    { attrs: { "slot-key": _vm.$parent.slotKey } },
    [
      _c("p", [
        _vm._v(
          "Tutorial: Get started with Go\nTable of Contents\nPrerequisites\nInstall Go\nWrite some code\nCall code in an external package\nWrite more code\nIn this tutorial, you'll get a brief introduction to Go programming. Along the way, you will:"
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          'Install Go (if you haven\'t already).\nWrite some simple "Hello, world" code.\nUse the go command to run your code.\nUse the Go package discovery tool to find packages you can use in your own code.\nCall functions of an external module.\nNote: For other tutorials, see Tutorials.\nPrerequisites\nSome programming experience. The code here is pretty simple, but it helps to know something about functions.\nA tool to edit your code. Any text editor you have will work fine. Most text editors have good support for Go. The most popular are VSCode (free), GoLand (paid), and Vim (free).\nA command terminal. Go works well using any terminal on Linux and Mac, and on PowerShell or cmd in Windows.\nInstall Go\nJust use the Download and install steps.'
        ),
      ]),
      _vm._v(" "),
      _c("p", [_vm._v("Write some code\nGet started with Hello, World.")]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "Open a command prompt and cd to your home directory.\nOn Linux or Mac:"
        ),
      ]),
      _vm._v(" "),
      _c("p", [_vm._v("cd\nOn Windows:")]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "cd %HOMEPATH%\nCreate a hello directory for your first Go source code.\nFor example, use the following commands:"
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "mkdir hello\ncd hello\nEnable dependency tracking for your code.\nWhen your code imports packages contained in other modules, you manage those dependencies through your code's own module. That module is defined by a go.mod file that tracks the modules that provide those packages. That go.mod file stays with your code, including in your source code repository."
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "To enable dependency tracking for your code by creating a go.mod file, run the go mod init command, giving it the name of the module your code will be in. The name is the module's module path."
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "In actual development, the module path will typically be the repository location where your source code will be kept. For example, the module path might be github.com/mymodule. If you plan to publish your module for others to use, the module path must be a location from which Go tools can download your module. For more about naming a module with a module path, see Managing dependencies."
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v("For the purposes of this tutorial, just use example/hello."),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "$ go mod init example/hello\ngo: creating new go.mod: module example/hello\nIn your text editor, create a file hello.go in which to write your code."
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "Paste the following code into your hello.go file and save the file."
        ),
      ]),
      _vm._v(" "),
      _c("p", [_vm._v("package main")]),
      _vm._v(" "),
      _c("p", [_vm._v('import "fmt"')]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          'func main() {\nfmt.Println("Hello, World!")\n}\nThis is your Go code. In this code, you:'
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "Declare a main package (a package is a way to group functions, and it's made up of all the files in the same directory).\nImport the popular fmt package, which contains functions for formatting text, including printing to the console. This package is one of the standard library packages you got when you installed Go.\nImplement a main function to print a message to the console. A main function executes by default when you run the main package.\nRun your code to see the greeting."
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "$ go run .\nHello, World!\nThe go run command is one of many go commands you'll use to get things done with Go. Use the following command to get a list of the others:"
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "$ go help\nCall code in an external package\nWhen you need your code to do something that might have been implemented by someone else, you can look for a package that has functions you can use in your code."
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          'Make your printed message a little more interesting with a function from an external module.\nVisit pkg.go.dev and search for a "quote" package.\nLocate and click the rsc.io/quote package in search results (if you see rsc.io/quote/v3, ignore it for now).\nIn the Documentation section, under Index, note the list of functions you can call from your code. You\'ll use the Go function.\nAt the top of this page, note that package quote is included in the rsc.io/quote module.\nYou can use the pkg.go.dev site to find published modules whose packages have functions you can use in your own code. Packages are published in modules -- like rsc.io/quote -- where others can use them. Modules are improved with new versions over time, and you can upgrade your code to use the improved versions.'
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "In your Go code, import the rsc.io/quote package and add a call to its Go function.\nAfter adding the highlighted lines, your code should include the following:"
        ),
      ]),
      _vm._v(" "),
      _c("p", [_vm._v("package main")]),
      _vm._v(" "),
      _c("p", [_vm._v('import "fmt"')]),
      _vm._v(" "),
      _c("p", [_vm._v('import "rsc.io/quote"')]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "func main() {\nfmt.Println(quote.Go())\n}\nAdd new module requirements and sums.\nGo will add the quote module as a requirement, as well as a go.sum file for use in authenticating the module. For more, see Authenticating modules in the Go Modules Reference."
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "$ go mod tidy\ngo: finding module for package rsc.io/quote\ngo: found rsc.io/quote in rsc.io/quote v1.5.2\nRun your code to see the message generated by the function you're calling.\n$ go run .\nDon't communicate by sharing memory, share memory by communicating.\nNotice that your code calls the Go function, printing a clever message about communication."
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "When you ran go mod tidy, it located and downloaded the rsc.io/quote module that contains the package you imported. By default, it downloaded the latest version -- v1.5.2."
        ),
      ]),
      _vm._v(" "),
      _c("p", [
        _vm._v(
          "Write more code\nWith this quick introduction, you got Go installed and learned some of the basics. To write some more code with another tutorial, take a look at Create a Go module."
        ),
      ]),
    ]
  )
}
